import "./styles.css";


export default class page2 extends React.Component {
	constructor(props) {
	    super(props);
	    this.state = {
	      data: ""
	    };
	  }
	
	getData = () => {
		console.log("here");
		display = true;
	    fetch("/api")
	      .then(res => res.json())
	      .then(
	        (result) => {
	          this.setState({
	        	  data: result.message
	          })
	          console.log("made it here");
	        }
	      )
	  }
  render() {
    return (
      <div>
        <h1>{!data ? "Loading..." : data}</h1>
        <button onClick={this.getData}>get data</button>
        <p>{data}</p>
      </div>
    );
  }
}
